import React, { Component} from 'react';
import $ from 'jquery';
import data from "../data"; 
const Api = ({ type = 'button', handleClick, children }) => {
  return (
       <button type="button" onClick={handleClick}>
      Click me!
    </button>
  );
};
export default Api;
